import React from 'react';
import './App.css';
import { Route, Routes } from 'react-router-dom';
import ModalForm from './components/modal-form/ModalForm';
import { observer } from 'mobx-react-lite'

const App = observer(() => {
  return (
    <div className="App">
      <ModalForm/>
    </div>
  );
})

export default App;
